import React from 'react';
import ReactPlayer from 'react-player';

const MainBackVideo = () => {
    return (
        <div className="video-container">
            <ReactPlayer
                url='https://www.youtube.com/watch?v=G_H3j8EZCvs'
                playing
                loop
                muted
                width='100%'
                height='100%'
                style={{ position: 'absolute', top: '0', left: '0' }}
            />
        </div>
    );
}


export default MainBackVideo;
